import React, { useState } from 'react';
import ApiModule from './api';

const BlueprintSearch = () => {
    const [authorName, setAuthorName] = useState('');
    const [blueprints, setBlueprints] = useState([]);

    const handleSearch = async () => {
        const data = await ApiModule.fetchBlueprints(authorName);
        setBlueprints(data); // Guarda los planos en el estado
    };

    return (
        <div>
            <input
                type="text"
                value={authorName}
                onChange={(e) => setAuthorName(e.target.value)}
                placeholder="Enter author name"
            />
            <button onClick={handleSearch}>Search Blueprints</button>
            <table>
                <thead>
                    <tr>
                        <th>Blueprint Name</th>
                        <th>Points</th>
                    </tr>
                </thead>
                <tbody>
                    {blueprints.map((bp) => (
                        <tr key={bp.name}>
                            <td>{bp.name}</td>
                            <td>{bp.points}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default BlueprintSearch;
